const getData=(e,t)=>{const n=e.getAttribute(`data-${t}`);return n?JSON.parse(n):{}},elementWithinViewport=e=>{window.analytics.logEvent("Curated: Rendered",getData(e,"item"))};document.addEventListener("DOMContentLoaded",(()=>{window.analytics.logEvent("Page Loaded");document.querySelector(".product-main")&&window.analytics.logEvent("Video Loaded");document.querySelectorAll(".product").forEach((e=>{e.addEventListener("mouseenter",(()=>{window.analytics.logEvent("Product: Mouse Hover",getData(e,"item"))})),e.addEventListener("click",(()=>{window.analytics.logEvent("Product: Clicked",getData(e,"item"))}))}))}));